import React from 'react';
import ApiProgress from './shared/ApiProgress';
import UserLoginPage from './pages/UserLoginPage';
import LanguageSelector from './components/LanguageSelector';

function App() {
  return (
    <div className="App">
      <ApiProgress>
        <UserLoginPage />
      </ApiProgress>
      <LanguageSelector />
    </div>
  );
}

export default App;
